column3:
&quot;If you don't think this map, by my main man, isn't gorgeous, I don't know what the hell's wrong with you.&quot;

That's a double negative, Alex, my boy. Basically:

&quot;If you think this map, by my main man, is gorgeous, I don't know what the hell's wrong with you.&quot;

I don't think that's what you meant.

I love the way you word things, along with the cool articles!
&quot;The computer decided to be a f*cking wh*refaced b*tch.&quot;
LOL!

I am dissapointed at how skimpy your sentences for each map have become. Before, we used to get...

&quot;BuddyLee's weekly map, Mezzanine, looks to be one of the best maps of the week. This well-structured map, complete with a superb demo is well worth your looking at.&quot;

Now all we get is...

&quot;I like Minnarets!&quot;

&quot;World's favourite communitist.&quot;
I resent that, Kucharski!!!
=P

&quot;so maybe shutting the fuck up would help us all out a little? I'd love to hear what you have to say.&quot;

I think the funniest part is that these sentences are so close to each other. Oh the irony...

Also, thanks for putting this 3 legged lung cancer dog out of its misery.

&quot;The reason this weekly slice of joy was called The Sunday N is because that banner kicks more ass than Uma Thurman on a quest for revenge.&quot;
Thanks!

Also, Alex is lazy.
